  "variables": {
    "U": {
      "description": "Utility of accepting the offer",
      "range": {
        "min": "-inf",
        "max": "inf",
        "inclusive_min": false,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "calculated"
    },
    "split_self": {
      "description": "Proposed share for the participant in £",
      "range": {
        "min": 0,
        "max": "inf",
        "inclusive_min": true,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "data"
    },
    "split_opp": {
      "description": "Proposed share for the opponent in £",
      "range": {
        "min": 0,
        "max": "inf",
        "inclusive_min": true,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "data"
    },
    "beta": {
      "description": "Inequity aversion parameter; penalizes the utility in proportion to the advantageous inequality where split_self exceeds split_opp",
      "range": {
        "min": 0,
        "max": 10,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": true,
      "source": "learnable"
    }
  }
}
</VARIABLES>

<SUMMARY>
The model calculates the utility for the responder by subtracting a penalty term, proportional to the difference between the recipient’s and opponent’s shares, from the monetary share received. This captures inequity aversion (advantageous inequality) with a single learnable parameter beta.
</SUMMARY>

